class RunEzAaiOnMarkerFailed(LuigiTask):

    def requires(self):
        return {
            'meta': GtdbMetadataR207(),
        }

    def output(self):
        return LocalTarget(os.path.join(DIR_OUT_SENTINEL, self.fqn))

    def run(self):
        log('Running EzAAI on genomes that failed placement in the tree', title=True)
        self.make_output_dirs()

        for row in INPUT:
            run_on_input(row['gid'], row['to'])


def run_on_input(q_gid, r_gids):
    q_fna = os.path.join(get_gid_root(q_gid), f'{q_gid}.fna')

    ezaii_output_dir = '/tmp/ezaai'
    ezaai_output_db = os.path.join(ezaii_output_dir, 'db')
    ezaii_q_path = os.path.join(ezaii_output_dir, f'{q_gid}.db')
    os.makedirs(ezaai_output_db, exist_ok=True)

    cmds = [
        f'EzAAI extract -i {q_fna} -o {ezaii_q_path}',
    ]

    to_download = list()

    for r_gid in r_gids:
        r_fna = os.path.join(get_gid_root(r_gid), f'{r_gid}.fna')
        if not os.path.exists(r_fna):
            if r_gid.startswith('GCA'):
                r_gid_new = f'GCF{r_gid[3:]}'
            else:
                r_gid_new = f'GCA{r_gid[3:]}'
            r_fna = os.path.join(get_gid_root(r_gid_new))

            if not os.path.exists(r_fna):
                new_root = get_gid_root(r_gid, '/srv/home/uqamussi/projects/gunc-chimeras/output/genomes/aux')
                r_fna = os.path.join(new_root, f'{r_gid}.fna')

                if not os.path.exists(r_fna):
                    to_download.append(f'magna ncbi download {r_gid} {r_fna}.gz && gunzip {r_fna}.gz')

        r_out_path = os.path.join(ezaai_output_db, f'{r_gid}.db')
        cmds.append(f'EzAAI extract -i {r_fna} -o {r_out_path}')

    cmds.append(
        f'EzAAI calculate -i {ezaii_q_path} -j {ezaai_output_db} -o {ezaii_output_dir}/aai.tsv -t 8'
    )

    os.makedirs('/tmp/am', exist_ok=True)
    with open(f'/tmp/am/to_download_{q_gid}.sh', 'w') as f:
        f.write('\n'.join(to_download) + '\n')

    with open(f'/tmp/am/to_run_{q_gid}.sh', 'w') as f:
        f.write('\n'.join(cmds) + '\n')

    return
